import React, {useState} from "react";
import Header from "./components/Header/Header";
import Settings from "./components/Settings/Settings";
import Login from "./components/Login/Login";
import Dashboard from "./components/Dashboard/Dashboard";
import "./styles/partials/global.scss";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import { AuthProvider } from "./Auth/AuthProvider";
import Tracks from "./components/Tracks/Tracks";

const code = new URLSearchParams(window.location.search).get("code");

function App() {
  const [selectedTimeRange, setSelectedTimeRange] = useState(null);
  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/dashboard" element={code ? <Dashboard code={code} /> : <Navigate to="/" />} />
          <Route path="/" element={!code ? <><Login /><Settings /></> : <Navigate to="/dashboard" />} />
        <Route path="/dashboard/Tracks" element={<Tracks code={code} selectedTimeRange={selectedTimeRange} setSelectedTimeRange={setSelectedTimeRange} />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
